<h2>二、SDS动态字符串</h2>
<figure><figcaption></figcaption></figure>
<p><code>动态字符串</code> 是以 <strong>\\0</strong> 为分隔符。<code>最大容量</code> 是 redis 主动分配的一块内存空间，<code>实际存储内容</code> 是具体的存的数据。</p>
